import React, { useState } from "react";
import "./App.css";
import Grid from "./Grid";
import GameOver from "./GameOver";

function App() {
  const [gameOver, setGameOver] = useState(false);
  return (
    <div>
      <Grid gameOver={gameOver} setGameOver={setGameOver} />
      {gameOver ? <GameOver /> : <div></div>}
    </div>
  );
}

export default App;
